import React from 'react';

const SearchBox = ({searchfield, searchChange}) => (
	<div>
		<input
			className='pa3 mb4 ba b--green bg-lightest-blue' //框框的樣式顏色
			type='search' 
			placeholder='search robots'
			onChange = {searchChange} //onclange uses when every time the search changes
		/>
	</div>
)

export default SearchBox;
